INSERT INTO `film_person` VALUES (1,0,'Composes the music for all his movies. Is a self-taught composer who learned to write music using a computer software.','Is the son of a Spanish mother and a 44an father. His family moved back to Spain when he was 1 year old, and he grew up and studied in Madrid. He wrote, produced and directed his first short film La cabeza at the age of 19, and he was 23 when he directed his feature debut Thesis (1996). His film Open Your Eyes (1997) was a huge success in Spain and was distributed worldwide. It was remade in Hollywood by Cameron Crowe as Vanilla Sky (2001), starring Tom Cruise, Penelope Cruz (also the star of the original version) and Cameron Diaz. The Others (2001) is Amen bar\'s first English language film.',44,19009,99),(2,183,'He has directed one film that has been selected for the National Film Registry by the Library of Congress as being \"culturally, historically or aesthetically\" significant: Shrek (2001).','Andrew Adamson was born on December 1, 1966 in Auckland, 158. He is a producer and director, known for Shrek 2 (2004), Shrek (2001) and The Chronicles of Narnia: The Lion, the Witch and the Wardrobe (2005). He has been married to Michelle Jonas since 2018. He was previously married to Gyulnara Karaeva and Nikki Donald.',158,19009,99),(3,0,'Has two nieces, via younger brother Joe Russo.','Anthony J. Russo is an American filmmaker and producer who works alongside his brother Joseph Russo. They have directed You, Me and Dupree, Cherry and the Marvel films Captain America: The Winter Soldier, Captain America: Civil War, Avengers: Infinity War and Avengers: Endgame. Endgame is one of the highest grossing films of all time.',233,19009,99),(4,0,'Has a private bathroom designed to look like a public bathroom, complete with stalls and urinals in his house in New York.','Barry Sonnenfeld was born and raised in New York City. He graduated from New York University Film School in 1978. He started work as director of photography on the Oscar-nominated In Our Water (1982). Then Joel Coen and Ethan Coen hired him for Blood Simple (1984). This film began his collaboration with the Coen Bros., who used him for their next two pictures, Raising Arizona (1987) and Miller\'s Crossing (1990). He also worked with Danny DeVito on his Throw Momma from the Train (1987) and Rob Reiner on When Harry Met Sally... (1989) and Misery (1990). Sonnenfeld got his first work as a director from Orion Pictures on The Addams Family (1991), a box-office success released in November 1991 followed by its sequel, Addams Family Values (1993). He received critical acclaim for his fourth directorial effort, Get Shorty (1995). Produced by Jersey Films and based on a novel by Elmore Leonard, the film won a Golden Globe for best male performance.',233,19009,99),(5,170,'His father died the first day of filming Moulin Rouge! (2001).','Baz Luhrmann is an 14n writer, director and producer with projects spanning film, television, opera, theater, music and recording industries. He is regarded by many as a contemporary example of an auteur for his distinctly recognizable style and deep involvement in the writing, directing, design and musical components of all his work. As a storyteller, he \'s known as a pioneer of pop culture, fusing high and low culture with a unique sonic and cinematic language. He is the most commercially successful 14n director, with his films making up four of the top ten highest worldwide grossing 14n films ever.',14,19009,99),(6,173,'Without knowing him, Steven Spielberg and his company Amblin Entertainment sent him $5000 to finish funding for his final film project at NYU\'s Tisch School of the Arts after he sent out 20 letters to producers asking for help.','Brett Ratner is one of Hollywood\'s most successful filmmakers. His diverse films resonate with audiences worldwide and, as director, his films have grossed over $2 billion at the global box office. Brett began his career directing music videos before making his feature directorial debut at 26 years old with the action comedy hit Money Talks. He followed with the blockbuster Rush Hour and its successful sequels. Brett also directed The Family Man, Red Dragon, After the Sunset, X-Men: The Last Stand, Tower Heist and Hercules.',233,19009,99),(7,178,'Turned down the chance to direct \'\'X-Men\'\' three times because he believed that comic books were unintelligent. He changed his mind after reading some of the comics and watching the animated series.','Bryan Singer is an American film director and producer who got his start writing and co-directing the short film Lions Den with his classmates while he attended USC. He was hired by 20th Century Fox to direct X-Men, which helped kick-start the superhero renaissance. He later directed three sequels. He went to direct Superman Returns, a revival of the Superman film series starring Brandon Routh. He also directed Valkyrie, Bohemian Rhapsody and Jack the Giant Slayer.',233,19009,99),(8,184,'Younger brother of Paul Weitz.','Christopher John Weitz is an American filmmaker, producer and screenwriter who is known for Antz, Rogue One: A Star Wars Story, American Pie, About a Boy, The Twilight Saga: New Moon, Nutty Professor II: The Klumps and The Golden Compass. He is married to Mercedes Martinez since 2006 and has three children.',233,19009,99),(9,181,'He initially directed his Batman films so he could get funding and support for his bigger films. The one he had planned for years was Inception (2010).','Best known for his cerebral, often nonlinear, storytelling, acclaimed Academy Award winner writer/director/producer Sir Christopher Nolan CBE was born in London, England. Over the course of more than 25 years of filmmaking, Nolan has gone from low-budget independent films to working on some of the biggest blockbusters ever made and became one of the most celebrated filmmakers of modern cinema.',232,19009,99),(10,187,'Was originally attached to direct Star Wars: The Rise of Skywalker (2019) before dropping out, due to creative differences.','Born in San Francisco and raised in Oakland, Colin Trevorrow started making short films when he was 12 years old. He studied film and dramatic writing at New York University. After graduation, he wrote and directed \"Home Base\" a digital short that became one of the early viral successes on the internet. His first feature film, \"Safety Not Guaranteed\" was written by fellow NYU graduate Derek Connolly, who met Trevorrow while they were both interns on Saturday Night Live.',233,19009,99),(11,0,'Scanlon went on to co-direct the original short film, \"Mater and the Ghostlight,\" which is included as one of the bonus features on the \"Cars\" DVD.','Dan Scanlon joined Pixar Animation Studios in September 2001 as a storyboard artist on Pixar\'s award-winning feature films \"Cars\" and \"Toy Story 3.\" During the initial production stages for both films, he worked closely with the directors to bring their ideas to the screen.',233,19009,99),(12,185,'His favorite Harry Potter film is Harry Potter and the Prisoner of Azkaban (2004), one that was not directed by him','David Yates was born on October 8, 1963 in St. Helens, Merseyside, England, UK. He is a director and producer, known for Harry Potter and the Order of the Phoenix (2007), The Legend of Tarzan (2016) and Harry Potter and the Deathly Hallows: Part 2 (2011).',232,19009,99),(13,185,'Was guitarist of punk band, The Daredevils, with Brett Gurewitz of Bad Religion and Josh Freese of The Vandals.','Gore Verbinski, one of American cinema\'s most inventive directors who was a punk-rock guitarist as a teenager and had to sell his guitar to buy his first camera, is now the director of Pirates of the Caribbean: Dead Man\'s Chest (2006) which made the industry record for highest opening weekend of all time ($135,600,000) and grossed over $1 billion dollars worldwide.',233,19009,99),(14,170,'Is the first director to have directed both a Star Trek film and a Star Wars film.','Jeffrey Jacob Abrams was born in New York City and raised in Los Angeles, the son of TV producer parents. At 15, he wrote the music for Don Dohler\'s Nightbeast (1982). In his senior year of college, he and Jill Mazursky teamed up to write a feature film, which became Taking Care of Business (1990). He went on to write and produce Regarding Henry (1991) and Forever Young (1992). He also co-wrote Gone Fishin\' (1997) with Mazursky. Along with other Sarah Lawrence alumni, he experimented with computer animation and was contracted to develop pre-production animation for Shrek (2001).',233,19009,99),(15,188,'Married one of his producers and two of his actresses.','James Francis Cameron was born on August 16, 1954 in Kapuskasing, Ontario, 39. He moved to the 233 in 1971. The son of an engineer, he majored in physics at California State University before switching to English, and eventually dropping out. He then drove a truck to support his screenwriting ambition. He landed his first professional film job as art director, miniature-set builder, and process-projection supervisor on Roger Corman\'s Battle Beyond the Stars (1980) and had his first experience as a director with a two week stint on Piranha II: The Spawning (1982) before being fired.',39,19009,99),(16,161,'From 132 Wan and his family moved to Perth, 14, when he was seven years old. Wan attended the Royal Melbourne Institute of Technology.','James Wan (born 26 February 1977) is an 14n film producer, screenwriter and film director of 132n Chinese descent. He is widely known for directing the horror film Saw (2004) and creating Billy the puppet. Wan has also directed Dead Silence (2007), Death Sentence (2007), Insidious (2010), The Conjuring (2013) and Furious 7 (2015).',132,19009,99),(17,170,'Admitted that whenever Pixar has encountered a creative problem, they look to Miyazaki\'s films for inspiration.','Although born in Hollywood, John and his twin sister Johanna were raised in Whittier near Los Angeles. His parents were Jewell Mae (Risley), an art teacher, and Paul Eual Lasseter, a parts manager at a Chevrolet dealership. His mother\'s profession contributed to his interest in animation and particularly the Bugs Bunny and Daffy Duck cartoons which he would watch on television. It was when he was in High School that he realized that he could have a career in animation and he wrote to the Walt Disney Studios but nothing happened then In 1975 the Disney company started an animation course at Calarts - The California Institute of the Arts- and John, with encouragement from his mother, was one of the first to sign up. He and his class mates, who included the future animators and directors Brad Bird, and Tim Burton were taught by some of Disney\'s veteran animators such as Ollie Johnston and Frank Thomas.',233,19009,99),(18,175,'Filmed much of the 3 Doors Down video in Madison, Wisconsin and at West High school which he attended as a student.','Marc Webb is an American film and music video director. He directed over 100 music videos before he made his film directorial debut with 500 Days of Summer, a romantic comedy. He later directed The Amazing Spider-Man and its 2014 sequel starring Andrew Garfield and Emma Stone. He also directed Gifted and The Only Living Boy in New York.',233,19009,99),(19,185,'Worked as a dock worker in San Pedro, California prior to getting his \"big break\".','Peter Berg is an American actor, director, writer, and producer. His first role was in the Adam Rifkin road movie Never on Tuesday (1988). He went on to star in the World War 2 film A Midnight Clear (1992). Roles in Fire in the Sky (1993) and Cop Land (1997) followed, and the Tom Cruise films Collateral (2004) and Lions for Lambs (2007).',233,19009,99),(20,170,'Was 37 years old when he directed his first feature length film.','Zachary Edward \"Zack\" Snyder (born March 1, 1966) is an American film director, film producer, and screenwriter, best known for action and science fiction films. Snyder made his feature film debut with the 2004 remake Dawn of the Dead and has gone on to be known for his comic book movies and superhero films, including 300 (2007), Watchmen (2009), Man of Steel (2013) and its upcoming sequel, Batman v Superman: Dawn of Justice (2016). Snyder is the co-founder of Cruel and Unusual Films, a production company he established in 2004, alongside his wife Deborah Snyder and producing partner Wesley Coller.',233,19009,99),(21,194,'\"Skarsbrow\", i.e. he habitually lifts his left eyebrow quizzically','Alexander Johan Hjalmar Skarsg†rd was born in Stockholm, Sweden and is the eldest son of famed actor Stellan Skarsg†rd. Among his siblings are actors Gustaf Skarsg†rd, Bill Skarsg†rd, and Valter Skarsg†rd. For most of his formative years, his father was an acclaimed actor in Europe but had not yet achieved the international fame that came after his star turn in Breaking the Waves (1996).',213,19009,102),(22,179,'Has been considered the role of the Doctor on the BBC show Doctor Who. He previously appeared in two episodes of the show.','Andrew Russell Garfield was born in Los Angeles, California, to a British mother, Lynn, and American father, Richard Garfield. When he was three, he moved to Surrey, U.K., with his parents and older brother. He is of English and Polish Jewish heritage. Andrew was raised in a middle class family, and attended a private school, the City of London Freemen\'s School. He began acting in youth theatre productions while he was still at school. At age 19, he went to the Royal Central School of Speech and Drama.',233,19009,102),(23,189,'Received a lifetime ban from playing blackjack at Las Vegas\' Hard Rock Casino due to his card counting skills.','Benjamin G‚za \"Ben\" Affleck-Boldt was born on August 15, 1972 in Berkeley, California and raised in Cambridge, Massachusetts, to mother Chris Anne (Boldt), a school teacher, and father Timothy Byers \"Tim\" Affleck, a social worker. Ben has a younger brother, actor Casey Affleck, who was born in 1975. He is of mostly English, Irish, German, and Scottish ancestry. His middle name, G‚za, is after a Hungarian family friend who was a Holocaust survivor.',233,19009,102),(24,185,'He can also sing, play drums and piano.','\"British actor Benjamin Thomas Barnes was born in Cambridge, England, to Patricia (Becker), a relationship therapist, and Thomas Barnes, a professor of psychiatry. He has a brother, Jack. His mother is from South Africa while his father is English.',232,19009,102),(25,168,'When he was a child, one of his babysitters was Billie Holiday.','Billy Crystal was born on March 14, 1948 in Manhattan, New York, and was raised on Long Island. He is the youngest of three sons born to Helen (Gabler) and Jack Crystal. His father was a well-known concert promoter who co-founded Commodore Records and his mother was a homemaker. His family were Jewish emigrants from Russia, Austria, and Lithuania. With his father in the music business, Billy was no stranger to some of the top performers of the time. Legends such as Billie Holiday, Pee Wee Russell, and Eddie Condon regularly stopped by the Crystal household. At age 15, Billy faced a personal tragedy when his father died of a heart attack at the relatively young age of 54. This gave Billy a real appreciation of what his dad was able to accomplish while alive and what his mother did to keep the family together. Despite this tragedy, Billy was very upbeat and likable as a kid. He had a unique talent for making people laugh.',233,19009,102),(38,0,'Was named after his fathers favorite actor, John Wayne.','Wayne Wang is a key figure in the development of independent filmmaking, alternating major Hollywood studio films such as »The Joy Luck Club« with smaller, independent work like »Smoke«. Continuing to work in the two different worlds, Wang directed an independent digital film, »The Center of the World«, with Molly Parker and Peter Sarsgaard, followed by Sony/Revolutions hit comedy »Maid in Manhattan« with Jennifer Lopez. ',98,19009,99),(39,0,'Graduate of Connecticut College.','Kevin Wade is an American writer and producer. He began his career by writing plays, and one of his earliest works was \"Key Exchange\", staged in 1983 and later turned into a movie in 1985.',233,19009,147),(40,164,'Began her career as a dancer for Janet Jackson.','Jennifer Lynn Lopez was born on July 24, 1969 in The Bronx, New York City, New York to teacher Lupe López and computer specialist David López. The two Puerto Ricans were brought to the continental United States during their childhoods and eventually met while living in New York City. Their daughters would have a stable, middle-class upbringing.',233,19009,102),(41,180,'8th cousin of King Charles III.','Actor Ralph Nathaniel Twisleton-Wykeham-Fiennes was born on December 22, 1962 in Suffolk, England, to Jennifer Anne Mary Alleyne (Lash), a novelist, and Mark Fiennes, a photographer. He is the eldest of six children. Four of his siblings are also in the arts: Martha Fiennes, a director; Magnus Fiennes, a musician; Sophie Fiennes, a producer; and Joseph Fiennes, an actor. He is of English, Irish, and Scottish origin.',232,19009,102),(42,172,'Meryl Streep was among her very closest friends.','Natasha Jane Richardson was born in Marylebone, London, England, to director and producer Tony Richardson and actress Vanessa Redgrave. She was the sister of actress Joely Richardson, the niece of actors Corin Redgrave and Lynn Redgrave, and the granddaughter of actors Michael Redgrave and Rachel Kempson.',233,19009,102),(43,172,'He is a close friend of actress Meryl Streep.','Actor Stanley Tucci was born on November 11, 1960, in Peekskill, New York. He is the son of Joan (Tropiano), a writer, and Stanley Tucci, an art teacher. His family is Italian-American, with origins in Calabria.',233,19009,102),(44,185,'Started out in the 1970s as a writer for National Lampoon magazine.','John Hughes was an American film director, film producer, and screenwriter. He was credited for creating some of the most memorable comedy films of the 1980s and the 1990s, when he was at the height of his career. He had a talent for writing coming-of-age stories, and for depicting fairly realistic adolescent characters.',233,19009,147);
