INSERT INTO `production` VALUES (1,'2009-12-10','Avatar',162,1,'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.','https://www.imdb.com/video/vi531039513/?playlistId=tt0499549&ref_=tt_pr_ov_vi',2),(2,'2007-05-19','Pirates of the Caribbean: At World\'s End',169,1,'Captain Barbossa, long believed to be dead, has come back to life and is headed to the edge of the Earth with Will Turner and Elizabeth Swann. But nothing is quite as it seems.','https://www.imdb.com/video/vi3821315609/?playlistId=tt0449088&ref_=tt_pr_ov_vi',2),(3,'2015-10-26','Spectre',148,1,'A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.','https://www.imdb.com/video/vi3362042649/?playlistId=tt2379713&ref_=tt_ov_vi',2),(4,'2012-07-16','The Dark Knight Rises',165,1,'Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent\'s crimes to protect the late attorney\'s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham\'s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.','https://www.imdb.com/video/vi144884505/?playlistId=tt1345836&ref_=tt_ov_vi',2),(5,'2012-03-07','John Carter',132,1,'John Carter is a war-weary, former military captain who\'s inexplicably transported to the mysterious and exotic planet of Barsoom (Mars) and reluctantly becomes embroiled in an epic conflict. It\'s a world on the brink of collapse, and Carter rediscovers his humanity when he realizes the survival of Barsoom and its people rests in his hands.','https://www.imdb.com/video/vi2340397337/?playlistId=tt0401729&ref_=tt_ov_vi',2),(6,'2007-05-01','Spider-Man 3',139,1,'The seemingly invincible Spider-Man goes up against an all-new crop of villain – including the shape-shifting Sandman. While Spider-Man’s superpowers are altered by an alien organism, his alter ego, Peter Parker, deals with nemesis Eddie Brock and also gets caught up in a love triangle.','https://www.imdb.com/video/vi1939784217/?playlistId=tt0413300&ref_=tt_ov_vi',2),(7,'2010-11-24','Tangled',100,1,'When the kingdom\'s most wanted-and most charming-bandit Flynn Rider hides out in a mysterious tower, he\'s taken hostage by Rapunzel, a beautiful and feisty tower-bound teen with 70 feet of magical, golden hair. Flynn\'s curious captor, who\'s looking for her ticket out of the tower where she\'s been locked away for years, strikes a deal with the handsome thief and the unlikely duo sets off on an action-packed escapade, complete with a super-cop horse, an over-protective chameleon and a gruff gang of pub thugs.','https://www.imdb.com/video/vi385091865/?playlistId=tt0398286&ref_=tt_ov_vi',2),(8,'2015-04-22','Avengers: Age of Ultron',141,1,'When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.','https://www.imdb.com/video/vi2821566745/?playlistId=tt2395427&ref_=tt_ov_vi',2),(9,'2009-07-07','Harry Potter and the Half-Blood Prince',153,1,'As Harry begins his sixth year at Hogwarts, he discovers an old book marked as \'Property of the Half-Blood Prince\', and begins to learn more about Lord Voldemort\'s dark past.','https://www.imdb.com/video/vi1061421849/?playlistId=tt0417741&ref_=tt_ov_vi',2),(10,'2016-03-23','Batman v Superman: Dawn of Justice',151,1,'Fearing the actions of a god-like Super Hero left unchecked, Gotham City’s own formidable, forceful vigilante takes on Metropolis’s most revered, modern-day savior, while the world wrestles with what sort of hero it really needs. And with Batman and Superman at war with one another, a new threat quickly arises, putting mankind in greater danger than it’s ever known before.','https://www.imdb.com/video/vi1946858521/?playlistId=tt2975590&ref_=tt_ov_vi',2),(11,'2006-06-28','Superman Returns',154,1,'Superman returns to discover his 5-year absence has allowed Lex Luthor to walk free, and that those he was closest too felt abandoned and have moved on. Luthor plots his ultimate revenge that could see millions killed and change the face of the planet forever, as well as ridding himself of the Man of Steel.','https://www.imdb.com/video/vi641508889/?playlistId=tt0348150&ref_=tt_ov_vi',2),(12,'2008-10-30','Quantum of Solace',106,1,'Quantum of Solace continues the adventures of James Bond after Casino Royale. Betrayed by Vesper, the woman he loved, 007 fights the urge to make his latest mission personal. Pursuing his determination to uncover the truth, Bond and M interrogate Mr. White, who reveals that the organization that blackmailed Vesper is far more complex and dangerous than anyone had imagined.','https://www.imdb.com/video/vi1024524313/?playlistId=tt0830515&ref_=tt_ov_vi',2),(13,'2006-06-20','Pirates of the Caribbean: Dead Man\'s Chest',151,1,'Captain Jack Sparrow works his way out of a blood debt with the ghostly Davey Jones, he also attempts to avoid eternal damnation.','https://www.imdb.com/video/vi3077572377/?playlistId=tt0383574&ref_=tt_ov_vi',2),(14,'2013-07-03','The Lone Ranger',149,1,'The Texas Rangers chase down a gang of outlaws led by Butch Cavendish, but the gang ambushes the Rangers, seemingly killing them all. One survivor is found, however, by an American Indian named Tonto, who nurses him back to health. The Ranger, donning a mask and riding a white stallion named Silver, teams up with Tonto to bring the unscrupulous gang and others of that ilk to justice.','https://www.imdb.com/video/vi460432921/?playlistId=tt1210819&ref_=tt_pr_ov_vi',2),(15,'2013-06-12','Man of Steel',143,1,'A young boy learns that he has extraordinary powers and is not of this earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind.','https://www.imdb.com/video/vi705668633/?playlistId=tt0770828&ref_=tt_ov_vi',2),(16,'2008-05-15','The Chronicles of Narnia: Prince Caspian',150,1,'One year after their incredible adventures in the Lion, the Witch and the Wardrobe, Peter, Edmund, Lucy and Susan Pevensie return to Narnia to aid a young prince whose life has been threatened by the evil King Miraz. Now, with the help of a colorful cast of new characters, including Trufflehunter the badger and Nikabrik the dwarf, the Pevensie clan embarks on an incredible quest to ensure that Narnia is returned to its rightful heir.','https://www.imdb.com/video/vi1793261849/?playlistId=tt0499448&ref_=tt_ov_vi',2),(17,'2012-04-25','The Avengers',143,1,'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!','https://www.imdb.com/video/vi1891149081/?playlistId=tt0848228&ref_=tt_ov_vi',2),(18,'2011-05-14','Pirates of the Caribbean: On Stranger Tides',136,1,'Captain Jack Sparrow crosses paths with a woman from his past, and he\'s not sure if it\'s love -- or if she\'s a ruthless con artist who\'s using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Anne\'s Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesn\'t know who to fear more: Blackbeard or the woman from his past.','https://www.imdb.com/video/vi3747192089/?playlistId=tt1298650&ref_=tt_ov_vi',2),(19,'2012-05-23','Men in Black 3',106,1,'Agents J (Will Smith) and K (Tommy Lee Jones) are back...in time. J has seen some inexplicable things in his 15 years with the Men in Black, but nothing, not even aliens, perplexes him as much as his wry, reticent partner. But when K\'s life and the fate of the planet are put at stake, Agent J will have to travel back in time to put things right. J discovers that there are secrets to the universe that K never told him - secrets that will reveal themselves as he teams up with the young Agent K (Josh Brolin) to save his partner, the agency, and the future of humankind.','https://www.imdb.com/video/vi3916407065/?playlistId=tt1409024&ref_=tt_ov_vi',2),(20,'2014-12-10','The Hobbit: The Battle of the Five Armies',144,1,'Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebor\'s mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo\'s hands.','https://www.imdb.com/video/vi1092005657/?playlistId=tt2310332&ref_=tt_pr_ov_vi',2),(21,'2012-06-27','The Amazing Spider-Man',136,1,'Peter Parker is an outcast high schooler abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben and Aunt May. Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents\' disappearance – leading him directly to Oscorp and the lab of Dr. Curt Connors, his father\'s former partner. As Spider-Man is set on a collision course with Connors\' alter ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.','https://www.imdb.com/video/vi717595161/?playlistId=tt0948470&ref_=tt_ov_vi',2),(22,'2010-05-12','Robin Hood',140,1,'When soldier Robin happens upon the dying Robert of Loxley, he promises to return the man\'s sword to his family in Nottingham. There, he assumes Robert\'s identity; romances his widow, Marion; and draws the ire of the town\'s sheriff and King John\'s henchman, Godfrey.','https://www.imdb.com/video/vi73860121/?playlistId=tt0955308&ref_=tt_pr_ov_vi',2),(23,'2013-12-11','The Hobbit: The Desolation of Smaug',161,1,'The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.','https://www.imdb.com/video/vi2165155865/?playlistId=tt1170358&ref_=tt_ov_vi',2),(24,'2007-12-04','The Golden Compass',113,1,'After overhearing a shocking secret, precocious orphan Lyra Belacqua trades her carefree existence roaming the halls of Jordan College for an otherworldly adventure in the far North, unaware that it\'s part of her destiny.','https://www.imdb.com/video/vi2813395225/?playlistId=tt0385752&ref_=tt_pr_ov_vi',2),(25,'2005-12-14','King Kong',187,1,'In 1933 New York, an overly ambitious movie producer coerces his cast and hired ship crew to travel to mysterious Skull Island, where they encounter Kong, a giant ape who is immediately smitten with the leading lady.','https://www.imdb.com/video/vi4100440345/?playlistId=tt0360717&ref_=tt_pr_ov_vi',2),(26,'1997-11-18','Titanic',194,1,'84 years later, a 101-year-old woman named Rose DeWitt Bukater tells the story to her granddaughter Lizzy Calvert, Brock Lovett, Lewis Bodine, Bobby Buell and Anatoly Mikailavich on the Keldysh about her life set in April 10th 1912, on a ship called Titanic when young Rose boards the departing ship with the upper-class passengers and her mother, Ruth DeWitt Bukater, and her fiancé, Caledon Hockley. Meanwhile, a drifter and artist named Jack Dawson and his best friend Fabrizio De Rossi win third-class tickets to the ship in a game. And she explains the whole story from departure until the death of Titanic on its first and last voyage April 15th, 1912 at 2:20 in the morning.','https://www.imdb.com/video/vi1740686617/?playlistId=tt0120338&ref_=tt_ov_vi',2),(27,'2016-04-27','Captain America: Civil War',147,1,'Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.','https://www.imdb.com/video/vi174044441/?playlistId=tt3498820&ref_=tt_ov_vi',2),(28,'2012-04-11','Battleship',131,1,'When mankind beams a radio signal into space, a reply comes from ‘Planet G’, in the form of several alien crafts that splash down in the waters off Hawaii. Lieutenant Alex Hopper is a weapons officer assigned to the USS John Paul Jones, part of an international naval coalition which becomes the world\'s last hope for survival as they engage the hostile alien force of unimaginable strength. While taking on the invaders, Hopper must also try to live up to the potential his brother, and his fiancée\'s father, Admiral Shane, expect of him.','https://www.imdb.com/video/vi4081754393/?playlistId=tt1440129&ref_=tt_ov_vi',2),(29,'2015-06-09','Jurassic World',124,1,'Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.','https://www.imdb.com/video/vi1176612889/?playlistId=tt0369610&ref_=tt_ov_vi',2),(30,'2012-10-25','Skyfall',143,1,'When Bond\'s latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory, the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve - following a trail to the mysterious Silva, whose lethal and hidden motives have yet to reveal themselves.','https://www.imdb.com/video/vi973841433/?playlistId=tt1074638&ref_=tt_ov_vi',2),(31,'2004-06-25','Spider-Man 2',127,1,'Peter Parker is going through a major identity crisis. Burned out from being Spider-Man, he decides to shelve his superhero alter ego, which leaves the city suffering in the wake of carnage left by the evil Doc Ock. In the meantime, Parker still can\'t act on his feelings for Mary Jane Watson, a girl he\'s loved since childhood.','https://www.imdb.com/video/vi629801241/?playlistId=tt0316654&ref_=tt_ov_vi',2),(32,'2013-04-18','Iron Man 3',130,1,'When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.','https://www.imdb.com/video/vi2830738969/?playlistId=tt1300854&ref_=tt_ov_vi',2),(33,'2010-03-03','Alice in Wonderland',108,1,'Alice, an unpretentious and individual 19-year-old, is betrothed to a dunce of an English nobleman. At her engagement party, she escapes the crowd to consider whether to go through with the marriage and falls down a hole in the garden after spotting an unusual rabbit. Arriving in a strange and surreal place called \'Underland,\' she finds herself in a world that resembles the nightmares she had as a child, filled with talking animals, villainous queens and knights, and frumious bandersnatches. Alice realizes that she is there for a reason – to conquer the horrific Jabberwocky and restore the rightful queen to her throne.','https://www.imdb.com/video/vi975438873/?playlistId=tt1014759&ref_=tt_ov_vi',2),(34,'2006-05-24','X-Men: The Last Stand',104,1,'When a cure is found to treat mutations, lines are drawn amongst the X-Men and The Brotherhood, a band of powerful mutants organized under Xavier\'s former ally, Magneto.','https://www.imdb.com/video/vi3890348313/?playlistId=tt0376994&ref_=tt_ov_vi',2),(35,'2013-06-20','Monsters University',104,1,'A look at the relationship between Mike and Sulley during their days at Monsters University — when they weren\'t necessarily the best of friends.','https://www.imdb.com/video/vi2206049817/?playlistId=tt1453405&ref_=tt_ov_vi',2),(36,'2009-06-19','Transformers: Revenge of the Fallen',150,1,'Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.','https://www.imdb.com/video/vi2982019609/?playlistId=tt1055369&ref_=tt_ov_vi',2),(38,'2013-03-07','Oz: The Great and Powerful',130,1,'Oscar Diggs, a small-time circus illusionist and con-artist, is whisked from Kansas to the Land of Oz where the inhabitants assume he\'s the great wizard of prophecy, there to save Oz from the clutches of evil.','https://www.imdb.com/video/vi3322455833/?playlistId=tt1623205&ref_=tt_ov_vi',2),(39,'2014-04-16','The Amazing Spider-Man 2',142,1,'For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.','https://www.imdb.com/video/vi717595161/?playlistId=tt0948470&ref_=tt_pr_ov_vi',2),(40,'2010-12-10','TRON: Legacy',125,1,'Sam Flynn, the tech-savvy and daring son of Kevin Flynn, investigates his father\'s disappearance and is pulled into The Grid. With the help of a mysterious program named Quorra, Sam quests to stop evil dictator Clu from crossing into the real world.','https://www.imdb.com/video/vi4134312217/?playlistId=tt1104001&ref_=tt_ov_vi',2),(41,'2011-06-11','Cars 2',106,1,'Star race car Lightning McQueen and his pal Mater head overseas to compete in the World Grand Prix race. But the road to the championship becomes rocky as Mater gets caught up in an intriguing adventure of his own: international espionage.','https://www.imdb.com/video/vi1822465049/?playlistId=tt1216475&ref_=tt_ov_vi',2),(42,'2011-06-16','Green Lantern',114,1,'For centuries, a small but powerful force of warriors called the Green Lantern Corps has sworn to keep intergalactic order. Each Green Lantern wears a ring that grants him superpowers. But when a new enemy called Parallax threatens to destroy the balance of power in the Universe, their fate and the fate of Earth lie in the hands of the first human ever recruited.','https://www.imdb.com/video/vi3445005593/?playlistId=tt1133985&ref_=tt_ov_vi',2),(43,'2010-06-16','Toy Story 3',103,1,'Woody, Buzz, and the rest of Andy\'s toys haven\'t been played with in years. With Andy about to go to college, the gang find themselves accidentally left at a nefarious day care center. The toys must band together to escape and return home to Andy.','https://www.imdb.com/video/vi3676898329/?playlistId=tt0435761&ref_=tt_ov_vi',2),(44,'2009-05-20','Terminator Salvation',115,1,'All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.','https://www.imdb.com/video/vi360907545/?playlistId=tt0438488&ref_=tt_pr_ov_vi',2),(45,'2015-04-01','Furious 7',137,1,'Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.','https://www.imdb.com/video/vi4285973785/?playlistId=tt2820852&ref_=tt_ov_vi',2),(46,'2013-06-20','World War Z',116,1,'Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.','https://www.imdb.com/video/vi3616319001/?playlistId=tt0816711&ref_=tt_ov_vi',2),(47,'2014-05-15','X-Men: Days of Future Past',131,1,'The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.','https://www.imdb.com/video/vi3858345241/?playlistId=tt1877832&ref_=tt_pr_ov_vi',2),(48,'2013-05-05','Star Trek Into Darkness',132,1,'When the crew of the Enterprise is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis. With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction. As our heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.','https://www.imdb.com/video/vi410167577/?playlistId=tt1408101&ref_=tt_ov_vi',2),(49,'2013-02-27','Jack the Giant Slayer',114,1,'The story of an ancient war that is reignited when a young farmhand unwittingly opens a gateway between our world and a fearsome race of giants. Unleashed on the Earth for the first time in centuries, the giants strive to reclaim the land they once lost, forcing the young man, Jack into the battle of his life to stop them. Fighting for a kingdom, its people, and the love of a brave princess, he comes face to face with the unstoppable warriors he thought only existed in legend–and gets the chance to become a legend himself.','https://www.imdb.com/video/vi830449433/?playlistId=tt1351685&ref_=tt_ov_vi',2),(50,'2013-05-10','The Great Gatsby',143,1,'An adaptation of F. Scott Fitzgerald\'s Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby\'s nouveau riche existence, where obsession, madness, and tragedy await.','https://www.imdb.com/video/vi2949817881/?playlistId=tt1343092&ref_=tt_ov_vi',2),(51,'2010-05-19','Prince of Persia: The Sands of Time',116,1,'A rogue prince reluctantly joins forces with a mysterious princess and together, they race against dark forces to safeguard an ancient dagger capable of releasing the Sands of Time – gift from the gods that can reverse time and allow its possessor to rule the world.','https://www.imdb.com/video/vi3849520153/?playlistId=tt0473075&ref_=tt_ov_vi',2),(52,'2024-04-11','Baby Raindeer',30,1,'The story follows writer and performer Richard Gadd\'s warped relationship with a female stalker and the impact it has on him as he is ultimately forced to face a deep, dark buried trauma.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(53,'2001-08-02','The Others',104,1,'A woman who lives in her old, dark family home with her two photosensitive children becomes convinced that the house is haunted.','https://www.imdb.com/video/vi3201343001/?playlistId=tt0230600&ref_=tt_ov_vi',2),(54,'2024-04-11','Episode 1',30,1,'Richard Gadd plays Donny, a failing London comedian who gets entangled with a relentless stalker named Martha.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(55,'2024-04-11','Episode 2',30,1,'On a date with Teri, Donny opens up about his stalker. Trying to be kind, he gives Martha false hope, which only encourages her further.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(56,'2024-04-11','Episode 3',30,1,'Donny takes some time off from the pub and tries to make amends with Teri. But no matter how much he avoids Martha, he just can\'t escape from her for long.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(57,'2024-04-11','Episode 4',30,1,'As Donny reports Martha to the police, it triggers the memory of a traumatic experience he had with a man, Darrien, who he met at the Edinburgh Fringe Festival years before.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(58,'2024-04-11','Episode 5',30,1,'Liz learns the truth about Martha and asks Donny to move out of the house. It is looking like a fresh start for him and Teri, but his persistent memories are stopping them from getting truly close.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(59,'2024-04-11','Episode 6',30,1,'Martha finds new ways to get to Donny: by hurting the people he loves. With frustration building as the police fail to intervene, he riskily takes matters into his own hands.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(60,'2024-04-11','Episode 7',30,1,'For the first time in his career, Donny feels like he\'s getting somewhere. Until he makes one careless decision that allows Martha to explode back into his life.','https://www.imdb.com/video/vi2745026073/?playlistId=tt13649112&ref_=tt_ov_vi',2),(61,'2002-12-13','Maid in Manhattan',30,1,'A Senatorial candidate falls for a hotel maid, thinking she is a socialite, when he sees her trying on a wealthy womans dress.','https://www.imdb.com/video/vi3935764761/?playlistId=tt0252076=tt_pr_ov_vi',2);
